import React, { Component } from "react";
import BlackCar from "../assets/products/black-car.jpg";
import styles from "./Car.module.css";
export default class Car extends Component {
  state={
    carImage: BlackCar
  }
  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col-7">
            <img className={styles.thumnail} src={this.s} alt="" />
          </div>
          <div className="col-5">
            <button className={styles.btn}>Black</button>
            <button className={styles.btn}>Red</button>
            <button className={styles.btn}>Silver</button>
            <button className={styles.btn}>Steel</button>
          </div>
        </div>
      </div>
    );
  }
}
